pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract voting {
    struct Proposal {
        string name;
        uint256 VoteCount;
    }

    struct Voter {
        uint256 vote;
        bool voted;
        uint256 weight;
    }

    Proposal[] public proposals;

    mapping(address => Voter) public voters;

    address public chairperson;

    constructor() public {
        chairperson = msg.sender;
        voters[chairperson].weight = 1;
        // for (uint256 i = 0; i < proposalNames.length; i++) {
        //     proposals.push(Proposal({name: proposalNames[i], VoteCount: 0}));
        // }
    }

    function insertProposal(string memory name) public {
        proposals.push(Proposal({name: name, VoteCount: 0}));
    }

    //function createProposal(string memory name, uint256 number) public {}
    function giveRightToVote(address voter) public {
        require(
            msg.sender == chairperson,
            "Only the chairperson can give access to vote"
        );
        require(!voters[voter].voted, "The voter has already voted");
        require(voters[voter].weight == 0);
        voters[voter].weight = 1;
    }

    function vote(uint256 proposal) public {
        Voter storage sender = voters[msg.sender];
        require(sender.weight != 0, "Has no right to vote");
        require(!sender.voted, "Already voted");
        sender.voted = true;
        sender.vote = proposal;
        proposals[proposal].VoteCount =
            proposals[proposal].VoteCount +
            sender.weight;
    }

    function winningProposal() public view returns (uint256 winningProposal) {
        uint256 winningVoteCount = 0;
        for (uint256 i = 0; i < proposals.length; i++) {
            if (proposals[i].VoteCount > winningVoteCount) {
                winningVoteCount = proposals[i].VoteCount;
                winningProposal = i;
            }
        }
    }

    function winningName() public view returns (string memory winningName) {
        winningName = proposals[winningProposal()].name;
    }
}
